:root {
  /* Color */
  --color-white: #fff;
  --color-light-white: #eeeeee;
  --color-dark-white: #bdbdbd;
  --color-dark-grey: #4d4d4d;
  --color-grey: #616161;
  --color-light-grey: #7c7979;
  --color-blue: #5394db;
  --color-yellow: #ff0;
  --color-orange: #e69a45;
  --color-black: #000;

  /* Font Size */
  --font-large: 48px;
  --font-medium: 28px;
  --font-regular: 18px;
  --font-small: 16px;
  --font-micro: 14px;

  /* Font Weight */
  --weight-bold: 700;
  --weight-semi-bold: 600;
  --weight-regular: 400;

  /* Size */
  --size-border-radius: 4px;
}


html, body {
  max-width: 100%;
  height: 100%;
  margin: 0;
  padding: 0;
}

* {
  box-sizing: border-box;
}

body {
  font-family: sans-serif;
  background-color: #eeeeee;
  margin: 0;
  padding: 0;
  overflow-x: hidden;
}

.container {
  width: 100%;
}

header {
  position: fixed;
  width: 100%;
  padding: 1rem 2rem;
  display: flex;
  justify-content: space-between;
  align-items: center;
  top: 0;
  left: 0;
  color: white;
  z-index: 10;
  transition: all 350ms ease-in;
}

header.background {
  background-color: var(--color-orange);
}

.navbar-brand {
  font-family: 'Raleway', sans-serif;
  font-size: 3rem;
  padding: 0.2rem 0;
  border-top: 0.5rem solid #e69a45;
  border-bottom: 0.5rem solid #e69a45;
  color: var(--color-yellow);
  margin: 0;
}

.nav {
  width: 50%;
  display: block;
  transition: all 300ms ease-in;
}

.nav__items {
  display: flex;
  justify-content: space-between;
  align-items: center;
  font-size: 1.5rem;
  list-style: none;
}

.nav__items li {
  cursor: pointer;
  transition: transform 300ms ease-in;
}

.nav__items .active {
  color: var(--color-yellow);
  transform: scale(1.2);
}

/* hamburger menu */
.menu__btn {
  position: relative;
  display: none;
  justify-content: center;
  align-items: center;
  width: 50px;
  height: 50px;
  cursor: pointer;
  transition: all 0.5s ease-in-out;
}
.menu__btn-burger {
  width: 40px;
  height: 3px;
  background-color: #fff;
  border-radius: 5px;
  box-shadow: 0 2px 5px rgba(255,101,47, 0.2);
  transition: all 0.5s ease-in-out;
}
.menu__btn-burger::before,
.menu__btn-burger::after {
  content: '';
  position: absolute;
  width: 40px;
  height: 3px;
  background-color: #fff;
  border-radius: 5px;
  box-shadow: 0 2px 5px rgba(255,101,47, 0.2);
  transition: all 0.5s ease-in-out;
}
.menu__btn-burger::before {
  transform: translateY(-16px);
}
.menu__btn-burger::after {
  transform: translateY(16px);
}

.menu__btn.open .menu__btn-burger {
  transform: translateX(-50px);
  background-color: transparent;
  box-shadow: none;
}

.menu__btn.open .menu__btn-burger::before {
  transform: rotate(45deg) translate(35px, -35px);
}
.menu__btn.open .menu__btn-burger::after {
  transform: rotate(-45deg) translate(35px, 35px);
}
/* --------------------------------- */

.scrollBtn {
  position: fixed;
  z-index: 100;
  bottom: 2rem;
  right:  1rem;
  width: 4rem;
  height: 4rem;
  background-color: pink;
  color: #fff;
  font-size: 4rem;
  text-align: center;
  line-height: 3rem;
  cursor: pointer;
  opacity: 0;
  transition: all 350ms ease-in;
  pointer-events: none;
  cursor: default;
}

.scrollBtn.show {
  opacity: 1;
  pointer-events: auto;
  cursor: pointer;
}

#home {
  position: relative;
  width: 100%;
  height: 100vh;
  background-color: var(--color-blue);
  text-align: center;
}

.home__context {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  z-index: 3;
  transition: all 350ms ease-in-out;
}

.home__context h1 {
  font-size: 4rem;
  color: var(--color-white);
  margin-top: 0;
}

.home__context .name {
  color: var(--color-yellow);
  font-size: 5rem;
}

.home__context h2 {
  font-size: 2.5rem;
  color: var(--color-light-white);
}

.home__context h3 {
  margin-top: 2.5rem;
  font-size: var(--font-medium);
  color: var(--color-light-white);
}

#home img {
  position: absolute;
  top: 50%;
  left: 50%;
  width: 32rem;
  height: 43rem;
  transform: translate(-50%, -50%);
  opacity: 0.6;
}

.home__context .btn {
  display: inline-block;
  margin-top: 1rem;
  font-size: 1.8rem;
  padding: 0.8rem 1.5rem;
  border-radius: 10px;
  border: none;
  outline: none;
  cursor: pointer;
  background-color: #e69a45;
  color: #fff;
  font-weight: 600;
  transition: all 350ms ease-out;
}

.btn:hover {
  background-color: #fff;
  color: #262626;
}

.home__context-more {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  opacity: 0;
  z-index: 2;
  transition: all 350ms ease-in-out;
}

.home__context-more h1 {
  font-size: 4rem;
  color: var(--color-white);
  margin-top: 0;
}

.home__context-more .surgeon {
  color: var(--color-yellow);
}

.home__context-more h2 {
  font-size: 2.5rem;
  color: var(--color-white);
  margin-top: 0;
}

.home__context-more .just {
  color: var(--color-yellow);
}


#about {
  padding: 3rem 0;
}

#about h1,
#skills h1 {
  margin: 0;
  text-align: center;
  font-size: var(--font-large);
  color: #5394db;
}

.about__content {
  display: flex;
  justify-content: space-around;
  align-items: center;
}

.about__content img {
  width: 30%;
}

.about__text {
  width: 100%;
  flex-basis: 50%;
  font-size: 20px;
  color: var(--color-dark-grey);
  line-height: 2;
}

.sp {
  font-size: 30px;
  color: var(--color-blue);
  font-weight: var(--weight-semi-bold);
}

.sp1 {
  display: inline-block;
  background-color: var(--color-orange);
  padding: 0 6px;
  color: var(--color-light-white);
  margin: 0.5rem 0;
  margin-right: 0.5rem;
}

.spA {
  transform: rotate(3deg);
}
.spB {
  transform: rotate(-4deg);
}
.spC {
  transform: rotate(3deg);
}
.spD {
  transform: rotate(-4deg);
}
.spE {
  transform: rotate(3deg);
}
.spF {
  transform: rotate(-4deg);
}
.spG {
  transform: rotate(3deg);
}
.spH {
  transform: rotate(-4deg);
}

hr {
  width: 20%;
}

#gallery {
  background-color: var(--color-blue);
  padding: 3rem 1rem;
  opacity: 0.8;
}

#gallery h1 {
  margin: 0;
  text-align: center;
  font-size: var(--font-large);
  color: #fff;
}

/* Swiper CSS */
.swiper-container {
  width: 80%;
  padding-top: 50px;
  padding-bottom: 150px;
}

.swiper-slide {
  background-position: center;
  background-size: cover;
  width: 350px;
  height: 350px;
  -webkit-box-reflect: below 1px linear-gradient(transparent, transparent, #0006);
  -moz-box-reflect: below 1px linear-gradient(transparent, transparent, #0006);
  -ms-box-reflect: below 1px linear-gradient(transparent, transparent, #0006);
}

.swiper-pagination-bullet {
  border: 1px solid  #fff;
  opacity: 1;
  width: 10px;
  height: 10px;
}
.swiper-button-next,
.swiper-button-prev {
  color: #fff;
}
/* ---------------------------- */

#skills {
  padding: 3rem 0;
}

#skills h2 {
  margin-left: 2rem;
}

#skills h2 {
  text-align: center;
  margin: auto;
  margin-bottom: 3rem;
  border-bottom: 2px solid var(--color-dark-grey);
  width: 7rem;
  color: var(--color-grey);
}

#skills i,
#skills img {
  border: 1px solid;
  box-shadow: 0 0 10px ;
}

.frontend, 
.backend,
.mobile {
  margin-top: 5rem;
}

.frontend__items,
.backend__items {
  display: flex;
  justify-content: center;
  align-items: center;
  flex-wrap: wrap;
}

.frontend__items i, 
.backend__items i {
  font-size: 7rem;
  padding: 1rem;
  margin: 2rem;
}

.frontend__items img {
  width: 9rem;
  height: 9rem;
  padding: 1rem;
  margin: 2rem;
}

.backend__items img {
  width: 9rem;
  height: 9rem;
  padding: 1rem;
  margin: 2rem;
}

.mobile {
  width: 100%;
  text-align: center;
}

.mobile__items {
  display: inline-block;
  margin: 2rem;
}
.mobile__items i {
  font-size: 7rem;
  padding: 1.5rem;
}

.mobile__items p {
  margin-top: 0;
  font-size: 1.3rem;
  color: #61DAFB;
}

.frontend__items i,
.backend__items i,
.frontend__items img,
.backend__items img {
  transition: all 350ms ease-in-out;
}

.mobile__items {
  transition: all 350ms ease-in-out;
}

.frontend__items i:hover,
.backend__items i:hover,
.frontend__items img:hover,
.backend__items img:hover {
  transform: scale(1.1) rotate(45deg);
}

.mobile__items:hover {
  transform: scale(1.1) rotate(45deg);
}


#contact {
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: var(--color-blue);
}

#contact img {
  width: 30rem;
}

.contact__text {
  margin-left: 2rem;
}

.contact__text h2 {
  font-size: var(--font-large);
  color: var(--color-orange);
  font-weight: var(--weight-bold);
}

.contact__text h3 {
  font-size: var(--font-medium);
  color: var(--color-light-white);
}
.contact__text p {
  color: var(--color-light-white);
  font-weight: var(--weight-bold);
}
.contact__text-social {
  font-size: 3rem;
  color: var(--color-light-white);
}

@media screen and (max-width: 1035px) {
  #contact img {
    width: 20rem;
  }
}

@media screen and (max-width: 1024px) {
  #home img {
    width: 80%;
    height: 80%;
  }

  .navbar-brand {
    font-size: 3rem;
    border-top: 0.3rem solid #e69a45;
    border-bottom: 0.3rem solid #e69a45;
  }

  .nav {
    position: fixed;
    top: 3.1rem;
    right: 0;
    overflow-x: hidden;
    width: 0;
    /* height: 0; */
    z-index: 20;
  }
  .nav__items {
    flex-direction: column;
    text-align: center;
    padding: 3rem;
    background-color: var(--color-blue);
    font-weight: 900;
  }
  .nav__items li {
    margin-bottom: 2rem;
  }
  .nav__items li:last-child {
    margin-bottom: 0;
  }

  .nav.open {
    width: 100%;
    /* height: 100%; */
  }

  .menu__btn {
    display: flex;
  }

  .home__context {
    width: 90%;
  }

  .home__context-more {
    width: 90%;
  }

  .home__context h1 {
    font-size: 4rem;;
  }

  .about__content {
    display: flex;
    flex-direction: column;
    justify-content: center;
  }

  .about__content img {
    width: 18rem;
    margin-top: 3rem;
    margin-bottom: 1rem;
  }

  .about__text {
    width: 80%;
    flex-basis: 50%;
    font-size: 16px;
    color: var(--color-dark-grey);
    line-height: 1.5;
  }
  hr {
    width: 100%;
  }
}

@media screen and (max-width: 902px) {
  #contact img {
    width: 15rem;
  }
  .contact__text h2 {
    font-size: var(--font-medium);
  }

  .contact__text h3 {
    font-size: var(--font-regular);
  }
  .contact__text p {
    color: var(--color-light-white);
  }
  .contact__text-social {
    font-size: 3rem;
  }
}

@media screen and (max-width: 790px) {
  .home__context {
    width: 90%;
    height: 50%;
  }
  .home__context h1 {
    font-size: 2.5rem;
  }
  .home__context .name {
    font-size: 3rem;
  }
  .home__context h2 {
    font-size: 2rem;
  }
  .home__context h3 {
    font-size: 1.8rem;
  }
  .home__context .btn {
    margin-top: 2rem;
    font-size: 1.3rem;
    padding: 0.5rem 1rem;
    border-radius: 5px;
  }
  #home img {
    width: 60%;
    height: 70%;
    object-fit: cover;
  }
  .home__context-more {
    width: 90%;
  }
  .home__context-more h1 {
    font-size: 2rem;
  }

  .home__context-more h2 {
    font-size: 1.5rem;
  }
}


@media screen and (max-width: 765px) {
  header {
    padding: 0.5rem 0.8rem;
  }
  .nav {
    top: 2.1rem;
  }
  .navbar-brand {
    font-size: 1.5rem;
  }

  .swiper-pagination {
    display: none;
  }
  .swiper-button-next,
  .swiper-button-prev {
    display: none;
  }
  .swiper-container {
    width: 90%;
    padding-bottom: 0;
  }
  .swiper-slide {
    background-position: center;
    background-size: cover;
    width: 350px;
    height: 350px;
  }
  .scrollBtn {
    bottom: 1rem;
    right: 0.5rem;
    width: 2.5rem;
    height: 2.5rem;
    line-height: 2.5rem;
    font-size: 2.5rem;
  }
}

@media screen and (max-width: 540px) {
  #home img {
    width: 80%;
  }

  .menu__btn-burger {
    width: 35px;
    height: 2px;
  }
  .menu__btn-burger::before,
  .menu__btn-burger::after {
    width: 35px;
    height: 2px;
  }
  .menu__btn-burger::before {
    transform: translateY(-10px);
  }
  .menu__btn-burger::after {
    transform: translateY(10px);
  }
}

@media screen and (max-width: 500px) {
  #contact {
    flex-direction: column;
    padding: 1rem 0;
    text-align: center;
  }
  #contact img {
    width: 20rem;
  }
}

@media screen and (max-width: 350px) {
  .home__context h1 {
    font-size: 2rem;
  }
  .home__context .name {
    font-size: 2.5rem;
  }
  .home__context h2 {
    font-size: 2rem;
  }
  .home__context h3 {
    font-size: 1.8rem;
  }
  .home__context .btn {
    margin-top: 2rem;
    font-size: 1.3rem;
    padding: 0.5rem 1rem;
    border-radius: 5px;
  }
  #home img {
    width: 80%;
    height: 60%;
    object-fit: cover;
  }
  .home__context-more {
    width: 90%;
  }
  .home__context-more h1 {
    font-size: 2rem;
  }

  .home__context-more h2 {
    font-size: 1.5rem;
  }
}
